import React, { Component } from 'react';
import { BrowserRouter, Route } from 'react-router-dom';

import history from './history';
import Header from './Components/Header'
import BookManagement from './Components/BookManagement'
import Join from './Components/Join'
import Login from './Components/Login'
import Main from './Components/Main'
import MyInfo from './Components/MyInfo'

class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <Header></Header>
        <Route exact path="/" render={(props) => <Main {...props}></Main>} />
        <Route path="/join" render={(props) => <Join {...props}></Join>} />
        <Route path="/login" render={(props) => <Login {...props}></Login>} />
        <Route path="/myInfo" render={(props) => <MyInfo {...props}></MyInfo>} />
        <Route path="/bookManagement" render={(props) => <BookManagement {...props}></BookManagement>} />
      </BrowserRouter>
    );
  }
}

export default App;
